import React from 'react';
import './App.css';
import Login from './Login';
import Register from './Register';
import {Route, Switch} from 'react-router-dom';
import MainContainer from './MainContainer';


const my404 = () => {
  return(
    <div>
      <h3>Error!</h3>
    </div>
  )
}


function App() {
  return (
    <main>
      <Switch>
        <Route component={my404} />
      </Switch>
    </main>
  );
}

export default App;
